  \"Temperature, salinity and dissolved oxygen profile data from globally distributed
  Argo profiling floats through the month of July 2015 for the Global Argo Data Repository,
  1995-09-07 to 2015-07-31 (NODC Accession 0042682)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:16:56.234986\",\n\t\"name\": \"temperature-salinity-and-dissolved-oxygen-profile-data-from-globally-distributed-argo-prof\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data represent all data collected
  from Argo profiling floats through the current month (July 2015). The U.S. National
  Oceanographic Data Center (NODC) operates the Global Argo Data Repository (GADR)
  as the long-term archive for the International Global Argo Project (for additional
  information about Argo, see http://www.argo.ucsd.edu/). Argo data have been archived
  by the US NODC on a monthly basis starting the second quarter of FY 2003. These
  data may include real-time and/or delayed-mode profiles of ocean temperature, salinity,
  dissolved oxygen as well as related conductivity and/or pressure measurements. These
  data were collected by Argo profiling floats and other profiling float data not
  directly handled by the Argo data assembly centers. Profiling floats have been deployed
  since 1995 by several research projects.\",\n\t\"license_title\": \"License Not
